import React from 'react'
import './page2.css'
function Page2() {
  return (
    <div className='scrollmenu' >
        <img src="image1.jpg" alt="laptop1"/>
        <img src="image2.jpg" alt="laptop2"/>
        <img src="image3.jpg" alt="laptop3"/>
        <img src="image4.jpg" alt="laptop4"/>
    </div>
  )
}
export default Page2;
